import angular from 'angular'

let app = angular.module('FrontOffice', [])
app.controller('LoginCtrl', function($scope){
    $scope.signIn = false
    $scope.signUp = false
    $scope.registerPage = function(){
        $scope.signIn = false
        $scope.signUp = true
    }
})

export default{
    template: require('../views/Login.html')
}
